# ## Bronze Layer Load

# MARKDOWN ********************

# The bronze layer load is completed as part of the Load HR Data Pipeline. The steps used for the load are as follows:
# 
# 1. Read the dbo.watermark_table for a list of the source tables to load and the current watermark values withint the Bronze tables.
# 2. Filter to include just the rows with the 'include in load' = 1.
# 3. Read from the source tables all records with a watermark value greater than that in the target bronze table (ensuring and incremental load).
# 4. Run an update watermark Tables notebook which will read the max value from all rows loaded and update the dbo.watermark_table with these values.
# 5. Full load (overwrite) of the 8 week checkin and exit interview data using the dataverse connection.
# 
# 
# 
# Please note the following:
# The 8 week checkin and exit interviews are small tables with the fields more subject to change. For this reason an 'overwrite' table action is carried out. 
# The dataverse tables are populated by the completion of microsoft forms. The forms can be accessed here:
# - [8 week checkin](https://forms.office.com/Pages/DesignPageV2.aspx?subpage=design&token=67f9a5fadbed4dfd9881b79e801bf11a&id=V3VPmeSIaUiXU-_LhZ_w8KHStaLBfGdAoZJXYB5Zb2NUREozUzdIODdWVFY5RlhMVlpKWlgxQVlSSCQlQCN0PWcu)
# - [Exit interview](https://forms.office.com/?redirecturl=https%3a%2f%2fforms.office.com%2fPages%2fDesignPageV2.aspx%3fsubpage%3ddesign%26FormId%3dV3VPmeSIaUiXU-_LhZ_w8KHStaLBfGdAoZJXYB5Zb2NUMVRHR1lGNVRMNE8zOVhKME9aOTI5UzhOUyQlQCN0PWcu%26Token%3d3e48090cf33844fe82a917ba7a156393&auth_pvr=OrgId)


