# ## Silver Layer Load

# MARKDOWN ********************

# The silver layer load is completed through the notebook: Load the Silver Layer.
# 
# 
# - This script will use the table details (bronze and silver) located in the dbo.watermark table to complete a merge from silver to bronze 
# - A rank function is used to ensure that only the most recent version of each record is merged to silver. This is required as bronze tracks changed values. 
# - The script will also update the silver_watermark_value with the max value in the silver target table ensuring only incremental merge activities are carried out.
# - The 8 week checkin and exit Interviews use an overwrite and as such are not part of the for each merge used with the incremental load tables. 

