# ## Full Run Order of Operations
# 
# This is the order of operations when you want to carry out the initial run / process. 
# To restart this process you need to use the 'Truncate all tables' notebook. This will also truncate the dbo.watermark_table allowing a fresh complete load.

# MARKDOWN ********************

# 1. <u>Create and Populate Watermark Tables</u>: This is used to Create and then populate the watermark tables used in the load
# 2. <u>Create Silver Tables</u>: This is used to create the silver tables and constraints ready for the full load.
# 3. <u>DW Calendar Pipeline</u>: This data pipeline will load (via overwrite) calendar information from the on premise DW. This is can be run periodically as the values will rarely change.
# 4. <u>Load HR Data Pipeline</u>: This will carry out the full medallion load for the data from the on premise HR 2 Prod database. 

