# ## Dev ops and branching

# MARKDOWN ********************

# Please note the following Git Configuration for the Data Engineering Dev Environment:
# 
# | Organisation | Project | Repository  
# |----------|----------|----------|
# | [KeepMoatFabric](https://dev.azure.com/KeepMoatFabric/)  | [KeepMoat_DataEngineering](https://keepmoatfabric.visualstudio.com/KeepMoat_DataEngineering)   | [KeepMoat_DataEngineering](https://keepmoatfabric.visualstudio.com/KeepMoat_DataEngineering/_git/KeepMoat_DataEngineering)   
# 
# 
# 
# 
# Following the configuration of the Git integration the branches tab will appear in the source control panel of the dev workspace (Data Engineer Dev). The branch tab has 2 main actions: 
#  
# 
# 1. - Branch out to a new workspace (Contributor permission required for workspace and capacity)  
# 2. - Checkout a new branch (Workspace Admin Permission required) 
# 
# 
# 
# 1. Branch out to a new workspace 
# 
# The developer (using a contributor permission) will be able to select an option to branch to a new workspace. This action will create a new feature branch within the dev Ops Repo linked to a new isolated workspace the developer will be the administrator of.  
# 
# The developer will push the changes from the workspace to the feature branch where it can then be merged with the main branch linked to the dev workspace. The developer must then delete the workspace when the development on the feature is completed.  
# 
# The recommended naming conventions for the branches and workspaces created for this purpose should be  
# 
# Workspace: Dev-(developer name)-workstream(engineer/analytics etc) 
# 
# Branch: (devname)-feature-(action being taken) 
# 
# 2.Checkout a new branch 
# 
# A checkout new branch will create a new feature branch within the current development workspace. The default branch for the workspace will also be changed to the current branch. Following the completion of development activities against the feature branch the changes need to be committed to the Dev ops repository where a merge to the main branch can be carried out.  The merge activity will typically delete the feature branch.  
# 
# Main Branch: The primary branch reflecting the production ready state of the code 
# 
# Feature branches: Individual branches created from the development branch for working on specific features or tasks.  

